   "source": [
    "# Google Data Analytics Certification Capstone Project: Cyclistic Bike-Share\n",
    "\n",
    "**Scenario:**\n",
    "I am positioned as a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. It launched a bike-share program in 2016, since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime. There are two type of customers,\n",
    "* Customers who purchase single-ride or full-day passes are referred to as casual riders. \n",
    "* Customers who purchase annual memberships are Cyclistic members.\n",
    "\n",
    "Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Hence the director believes that maximizing the number of annual members will be key to future growth. Therefore, my team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, my team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve the recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n"
   ]
  },
