   "source": [
    "# ASK:\n",
    "**1.Identify the business task:**\n",
    "*  The company wants to improve its revenue by maximizing the number of annual members aimed at converting casual riders into members. For which the difference between casual and annual members has to be analyzed and a focused and successful marketing message has to be created to make casual riders avail of the annual subscription.\n",
    "\n",
    "**2.Consider key stakeholders:**\n",
    "* The director of marketing and my manager, Lily Moreno\n",
    "* My marketing analytics team\n",
    "* Cyclistic executive team"
   ]
  },
