    "From the graph above it is clear that, \n",
    "\n",
    "Members' usage is high during the mid-week with the highest on Thursday and starts to decline towards the weekend, while the casual riders' usage gradually increases towards the weekend with the highest on Saturday.\n",
    "\n",
    "**This might suggest that members use the bikes for their work and casual riders use them for leisure.**"
