    "#7. Visualizing the bike demand by hour in a day\n",
    "halfyearly %>%\n",
    "    ggplot(aes(time, fill= member_casual)) +\n",
    "    labs(x=\"Hour of the day\",y=\"Number of rides\" ,title=\"Bike demand by hour in a day\", fill= \"user type\") +\n",
    "    geom_bar(position=\"dodge\")"
   ]
