   "source": [
    "The hourly bike usage graph shows us that bike usage rises from 05:00 through 08:00 for member riders, which might indicate that member riders are reporting for work. Then the usage drops between 08:00 and 10:00, consolidates till 14:00, and gradually rises from 15:00, with the peak at 17:00 which suggests members are leaving work and completely drops from there until 23:00. This cycle continues through weekdays for member riders.\n",
    "\n",
    "Casual riders have the same peak at around 17:00, however the overall usage growth shows a gradual upward trend without a very sharp spike between 05:00 and 17:00."
   ]
