   "source": [
    "It is interesting to see that,\n",
    "* Docked bikes are used only by casual riders and it has been used only for 3 months - June, July, and August\n",
    "* There is a clear upward and gradual downward trend in the usage of classic bikes while there is a clear decrease in the usage of electric bikes by both user types.\n",
    "\n",
    "**This can be interpreted as the company had initially tested the docked bikes with riders and may have stopped acquiring them due to less usage or vice versa. For the other two bikes, the trend can be compared with the number of rides.**"
   ]
